import SimpleImageSlider from "react-simple-image-slider";

const Home = ()=>{
    return(
        <div className="PHome">
           <div className="slider">
            <SimpleImageSlider
                width={896}
                height={504}
                images={images}
                showBullets={true}
                showNavs={true}
            />
            </div>
        </div>
    )
}
export default Home;
